import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View, Button } from "react-native";
import * as Google from "expo-google-app-auth";

const hello = () => {
  console.log("hello");
};

const iosClientId =
  "561300838013-moddk7rl7plhahgitj8qs9v36pbi8km9.apps.googleusercontent.com";
const signInWithGoogleAsync = async function () {
  console.log("heelooo");
  try {
    const result = await Google.logInAsync({
      iosClientId: iosClientId,
      scopes: ["profile", "email", "age"],
    });

    if (result.type === "success") {
      console.log(result);
      return result.accessToken;
    } else {
      console.log("fail");
      return { cancelled: true };
    }
  } catch (e) {
    console.log("error");
    return { error: true };
  }
};

const signInWithNaverAsync = async function () {
  console.log("naver!");
};

export default function App() {
  return (
    <View style={styles.container}>
      <Button title="Google Login" onPress={signInWithGoogleAsync} />

      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
